import React, { useState } from "react";
import "./ProductCards.css";
import { useAuth } from './AuthContext';
import { toast } from 'react-toastify';

function ProductCards({ products, itemsPerPage = 24 }) {
  const [currentPage, setCurrentPage] = useState(1);
  const { isAuthenticated, addToCart, cartLoading } = useAuth();
  const totalPages = Math.ceil(products.length / itemsPerPage);

  const handleNextPage = () => currentPage < totalPages && setCurrentPage(currentPage + 1);
  const handlePrevPage = () => currentPage > 1 && setCurrentPage(currentPage - 1);

  const handleAddToCart = async (product) => {
    if (!isAuthenticated) {
      toast.error('Please login to add items to cart');
      return;
    }

    const cartItem = {
      productId: product._id,
      productDescription: product.productDescription,
      brandName: product.brandName,
      price: parseFloat(product.price) || 0,
      storeName: product.storeName,
      productImageUrl: product.productImageUrl,
      addedAt: new Date().toISOString()
    };

    const success = await addToCart(cartItem);
    if (success) {
      toast.success(`${product.productDescription} added to cart!`);
    } else {
      toast.error('Failed to add item to cart');
    }
  };

  const startIndex = (currentPage - 1) * itemsPerPage;
  const selectedProducts = products.slice(startIndex, startIndex + itemsPerPage);

  return (
    <div className="product-cards-container">
      <div className="product-cards">
        {selectedProducts.map((product) => (
          <div className="card" key={product._id}>
            <div className="card-content">
              <h3>{product.productDescription}</h3>
              <p><strong>Brand:</strong> <span className="brand-name">{product.brandName}</span></p>
              <p className="price"><strong>Price:</strong> {product.price}</p>
              <p><strong>Store:</strong> {product.storeName}</p>
              <p><strong>Available since:</strong> {product.creationDate}</p>
              <div className="buttons">
                <button 
                  className="add-to-cart"
                  onClick={() => handleAddToCart(product)}
                  disabled={cartLoading}
                >
                  {cartLoading ? 'Adding...' : 'Add to Cart'}
                </button>
                <a
                  href={`https://${product.storeName}.com`}
                  target="_blank"
                  rel="noopener noreferrer"
                  className="go-buy"
                >
                  Go Buy
                </a>
              </div>
            </div>
            <ImageWithFallback
              src={product.productImageUrl}
              alt={product.productDescription}
              fallback={<div className="loading-spinner"></div>}
            />
          </div>
        ))}
      </div>
      
      <div className="pagination">
        <button onClick={handlePrevPage} disabled={currentPage === 1}>
          Prev
        </button>
        <span>Page {currentPage} of {totalPages}</span>
        <button onClick={handleNextPage} disabled={currentPage === totalPages}>
          Next
        </button>
      </div>
    </div>
  );
}

function ImageWithFallback({ src, alt, fallback }) {
  const [isError, setIsError] = useState(false);
  return isError ? fallback : (
    <img src={src} alt={alt} onError={() => setIsError(true)} />
  );
}

export default ProductCards;
